import React from 'react';

const SearchBox = ({searchfield, searchChange}) => {
	return (
		<div className= 'pa2'>
			<input className='tc white pa2 bg-dark-green shadow-5'
			type='search' 
			placeholder='search robots' 
			onChange={searchChange}
			/>
		</div>
		);
}

export default SearchBox;
